import React,{Component}from 'react';
import axios from 'axios';
// const apiKey="acace3393ded528905dd2a68775695f1";
// const apiUrl="api.openweathermap.org/data/2.5";


class App extends Component {
  state={
    weather:{},
    city:'',
    country:'',
  }
  componentDidMount(){
    this.getData();
  }
  getData=()=>{
    axios
    .get(`https://api.openweathermap.org/data/2.5/weather?q=vancouver&appid=acace3393ded528905dd2a68775695f1`)
    .then((response)=>{
      console.log(response.data);
      this.setState({        
        city: response.city,      
      })
    })
  }

  render(){
    console.log(this.state.weather.name);

    return (

           Object.keys(this.state.weather).map((obj) => 

            <div>
                temp:{this.state.weather[obj].temp} ;
                feels_like {this.state.weather[obj].feels_like}
            </div>

    ))   

}
}

export default App;
